import React from "react";
import "./tashuView.css"; // 팝업에 대한 스타일을 정의한 CSS 파일

export default function TashuView({ add, pk, onCloseClicked, isVisible }) {
    
    const classList = {
        "tashu-view": true,
        "hidden": !isVisible,
    };
    return (
        <div className={toggleClassList(classList)}>
            <button className="tashu-view-close-btn" onClick={onCloseClicked}>X</button>
            <div className="tashu-view-title">타슈 정보</div>
            <div className="tashu-view-address">주소: {add}</div>
            <div className="tashu-view-description">키: {pk}</div>
        </div>
    )
}

function toggleClassList(list) {
    let classList = [];
    for(const [k, v] of Object.entries(list)) {
        if(!!v) {
            classList.push(k);
        }
    }
    return classList.join(" ");
}
